    "description": "Charley Young Beach\nKihei, Maui, HI\n03-21-23\n\nProcessed: 11/05/23\n\nHere's a &quot;new&quot; previously unprocessed photo of the sea churning around in the lava rocks on Charley Young Beach in Kihei, Maui, HI, right across the street from the condo complex where I stayed. \n\nI thought it was so great that after coming back from a whole day of taking photos, I could go &quot;home&quot; and catch the sunset right across the street before retiring to my condo for the night. Didn't have to get in the car and drive anywhere. If I ever go to Maui again, I'll probably stay in the same place!\n\nEDIT: Explored at 175 on 11/11/23. Thank you so very much to everyone who views, faves, follows, and comments on my images! \ud83d\ude4f\ud83d\ude4f\ud83d\ude4f\ud83d\ude4f\ud83d\udc96\ud83d\udc96\ud83d\udc96\ud83d\udc96\ud83c\udf81\ud83c\udf81\ud83c\udf81\ud83c\udf81\ud83c\udf89\ud83c\udf89\ud83c\udf89\ud83c\udf89\ud83d\ude02\ud83d\ude02\ud83d\ude02\ud83d\ude02\ud83d\ude2e\ud83d\ude2e\ud83d\ude2e\ud83d\ude2e\ud83d\ude01\ud83d\ude01\ud83d\ude01\ud83d\ude01\n\n\ud83d\udc40 <a href=\"https://www.facebook.com/michael.f.nyiri/\" rel=\"noreferrer nofollow\">Follow Me on Facebook</a>\n\ud83d\udcf7 <a href=\"https://www.instagram.com/michael_f_nyiri_photography/\" rel=\"noreferrer nofollow\">Follow Me on Instagram</a>\n\ud83d\udcb0 <a href=\"https://www.allthingsmike.com/photo-albums\" rel=\"noreferrer nofollow\">Photo Prints for Sale</a>",
