    "id": "53186521138",
    "title": "Final summer days",
    "description": "The sun sets over the Missouri River at Snowden, Montana on a calm evening, no noises to be heard but a pheasant's final calls, distant geese honking occasionally and coyotes yipping back and forth passing news back and forth across the river.  The days are obviously shorter now and the nights frequently far cooler.  Leaves have already begun to turn as the colors arrive, for autumn is to be here on the 23rd this year, only ten days away.  (9-13-2023)",
