    "id": "53350108602",
    "title": "Madeira Beach",
    "description": "Psalm 107:1-3 NIV\n\n1 Give thanks to the Lord, for he is good; his love endures forever.  2 Let the redeemed of the Lord tell their story\u2014those he redeemed from the hand of the foe, 3 those he gathered from the lands, from east and west, from north and south.  (from biblegateway.com)\n\n-------------------------------------------------------------------------------------------\n\n5 MORE THINGS YOU SHOULD KNOW:\n\n1. Like it or not, we are ALL sinners: As the Scriptures say, \u201cNo one is righteous\u2014not even one. No one is truly wise; no one is seeking God. All have turned away; all have become useless. No one does good, not a single one.\u201d (Romans 3:10-12 NLT)\n\n2. The punishment for sin is death: When Adam sinned, sin entered the world. Adam\u2019s sin brought death, so death spread to everyone, for everyone sinned. (Romans 5:12 NLT)\n\n3. Jesus is our only hope: But God showed his great love for us by sending Christ to die for us while we were still sinners. (Romans 5:8 NLT) For the wages of sin is death, but the free gift of God is eternal life through Christ Jesus our Lord. (Romans 6:23 NLT)\n\n4. SALVATION is by GRACE through FAITH in JESUS: God saved you by his grace when you believed. And you can\u2019t take credit for this; it is a gift from God. Salvation is not a reward for the good things we have done, so none of us can boast about it. For we are God\u2019s masterpiece. He has created us anew in Christ Jesus, so we can do the good things he planned for us long ago. (Ephesians 2:8-10 NLT)\n\n5. Accept Jesus and receive eternal life: If you openly declare that Jesus is Lord and believe in your heart that God raised him from the dead, you will be saved. (Romans 10:9 NLT) But to all who believed him and accepted him, he gave the right to become children of God. (John 1:12 NLT) And this is what God has testified: He has given us eternal life, and this life is in his Son. Whoever has the Son has life; whoever does not have God\u2019s Son does not have life. (1 John 5:11-12 NLT)\n\nRead the Bible for yourself. Allow the Lord to speak to you through his Word. YOUR ETERNITY IS AT STAKE!",
