    "title": "(explore 467 10/04/2021) Bird Tree / \u00c1rvore de P\u00e1ssaros",
    "description": "On the side of the BR-235 road, municipality of Carira, Sergipe Brasil, this practically dead tree, with only its trunk and dry branches, but with its roots soaked in a small pond, has in its afternoons, usually at sunset, some birds, mostly herons, which look like white leaves seen from afar, thus forming a large tree of &quot;white leaves&quot;.\n\nNa beira da estrada BR-235, munic\u00edpio de Carira, Sergipe Brasil, esta \u00e1rvore praticamente morta, apenas com o seu tronco e galhos secos, mas com suas ra\u00edzes encharcadas em um pequena lagoa, tem em suas tardes, geralmente no por do sol, alguns p\u00e1ssaros, na sua maioria gar\u00e7as, que mas parecem, folhas brancas vistas de longe, assim formando uma grande \u00e1rvore de &quot;folhas brancas&quot;.",
