    "id": "52549643000",
    "title": "Purang county landscape, Tibet 2019",
    "description": "Purang \u0f66\u0fa4\u0f74\u0f0b\u0f67\u0fb2\u0f7a\u0f44\u0f0b\u0f0d county\n\nPurang county is the heart of Far-West, where the four great rivers of South Asia diverge from their glacial sources around Mount Kailash (Gangs Rin Po Che, Ti-se) \u0f42\u0f44\u0f66\u0f0b\u0f62\u0f72\u0f53\u0f0b\u0f54\u0f7c\u0f0b\u0f46\u0f7a 6638m. It is the goal of the great pilgrimage routes which approach this sacred mountain from the north (Gegye or Xinjiang), from the west (Kinnaur in India), from the south (Almora in India known as Taklakot in Nepali, and from the east (Drongpa)). The county capital is located at Purang \u0f66\u0fa4\u0f74\u0f0b\u0f67\u0fb2\u0f7a\u0f44\u0f0b\u0f0d, known as Taklamot in Nepali. Area: 11.641 sq km. <a href=\"http://www.footprinttravelguides.com/c/2848/tibet/&amp;Action=product&amp;Product_Reference=TIBH04\" rel=\"noreferrer nofollow\">www.footprinttravelguides.com/c/2848/tibet/&amp;Action=pr...</a>",
