    "description": "After taking the previous <a href=\"https://www.flickr.com/photos/rickcameron/50736348333/in/photostream/\">woodpecker picture</a> I looked at the skies and thought I might be able to frame one of my favorite saguaros against the pink clouds of sunset. The problem was the saguaro was on the opposite side of the hill and to get to it I had to drop back down past the basketball courts and go up the other side of the trail. A part of me wanted to call it a night as the light was not likely to last that long but a part of me decided to try it, and that part won out and had me arriving just as the pink skies began to fade. I took a quick shot of the fading beauty, of the battered old giant with broken arms that sheltered so many birds during its long life, of the day fading into night. \n\n",
    "datetaken": "2020-12-13 17:28:45",
